import React, { useState } from "react";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [agreed, setAgreed] = useState([false, false, false]);

  const handleCheckboxChange = (index) => {
    const updated = [...agreed];
    updated[index] = !updated[index];
    setAgreed(updated);
  };

  const handleLogin = () => {
    // Implement login logic here
  };

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center px-4">
      <div className="w-full max-w-md bg-white shadow-lg rounded-lg p-8">
        <h2 className="text-2xl font-bold text-center mb-2">
          Welcome to SADQ â€“ Secure Access Portal
        </h2>
        <p className="text-sm text-center text-gray-600 mb-6">
          We've upgraded SADQ to a secure, user-authenticated platform to better protect usage data, support future enhancements, and ensure smooth clinical operations.
        </p>

        <input
          type="email"
          placeholder="Email"
          className="w-full mb-4 px-4 py-2 border border-gray-300 rounded focus:outline-none focus:ring"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />

        <input
          type="password"
          placeholder="Password"
          className="w-full mb-6 px-4 py-2 border border-gray-300 rounded focus:outline-none focus:ring"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <div className="space-y-4 mb-6 text-sm text-gray-700">
          <div className="flex items-start gap-2">
            <input
              type="checkbox"
              checked={agreed[0]}
              onChange={() => handleCheckboxChange(0)}
            />
            <label>I acknowledge that I am a clinical user authorized to access the SADQ tool.</label>
          </div>
          <div className="flex items-start gap-2">
            <input
              type="checkbox"
              checked={agreed[1]}
              onChange={() => handleCheckboxChange(1)}
            />
            <label>I understand that usage may be monitored for operational tracking and improvement purposes.</label>
          </div>
          <div className="flex items-start gap-2">
            <input
              type="checkbox"
              checked={agreed[2]}
              onChange={() => handleCheckboxChange(2)}
            />
            <label>I agree not to share access credentials or use the tool for unauthorized purposes.</label>
          </div>
        </div>

        <button
          onClick={handleLogin}
          className="w-full bg-indigo-400 text-white font-semibold py-2 rounded hover:bg-indigo-500 transition"
        >
          Log In
        </button>

        <p className="text-xs text-center mt-4 text-gray-500">
          If you have any issues or questions, contact{" "}
          <a href="mailto:support@genkimd.com" className="text-blue-600 underline">
            support@genkimd.com
          </a>
        </p>
      </div>
    </div>
  );
}

export default Login;
